body:
Suche Leute die die Mission mit mir spielen, in der wir zwei Turrets in 15 sec. machen m&uuml;ssen, in klar text brauchen wir ja nur champs mit hohen Tower damage Corkie + Tristana und am besten noch den Herold auf Support, der aktiviert den dann w&auml;hrend wir den ersten tower zerst&ouml;ren damit er gleich in den zweiten rush.
Das ist mein Plan, habt ihr ein besseren nehme ich den nat&uuml;rlich an, mir ist es egal wie will nur die quest haben. Elo am besten G5+ damit wir nicht zuweit auseinander stehen, bin selber Platin 4 Soloque, Platin 5 Flexque
